const logoBase64 = `
data:image/png;base64,
`;

function exportarResultadoPDF() {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF('p', 'mm', 'a4');

  function parseCRC(valor) {
    if (!valor) return 0;
    return parseFloat(
      valor
        .replace(/\s/g, '')
        .replace(/\./g, '')
        .replace(',', '.')
    ) || 0;
  }

  const verde = [13, 148, 136];
  const verdeClaro = [230, 247, 245];
  const gris = [120, 120, 120];

  doc.setFillColor(...verde);
  doc.rect(0, 0, 210, 30, 'F');

  doc.setTextColor(255, 255, 255);
  doc.setFontSize(16);
  doc.text('BOLETA DE CLCULO DE SALARIO', 105, 18, { align: 'center' });

  doc.addImage(logoBase64, 'PNG', 15, 6, 25, 20);

  doc.setTextColor(0, 0, 0);
  doc.setFontSize(10);
  doc.text(`Fecha: ${new Date().toLocaleDateString('es-CR')}`, 14, 38);

  let y = 50;
  let salarioBruto = 0;
  let montoCCSS = 0;

  doc.setFontSize(11);
  doc.setTextColor(...gris);
  doc.line(14, y - 6, 196, y - 6);

  document.querySelectorAll('.tabla-resultado tbody tr').forEach(row => {
    const cols = row.querySelectorAll('td');
    if (cols.length === 4) {
      const concepto = cols[0].innerText.trim();
      const cantidad = cols[1].innerText.trim();
      const montoTexto = cols[3].innerText.trim() || '0';

      doc.setTextColor(0, 0, 0);
      doc.text(concepto, 14, y);
      doc.text(cantidad, 110, y, { align: 'right' });

      if (!concepto.includes('Das trabajados')) {
        doc.text(`CRC ${montoTexto}`, 195, y, { align: 'right' });
      }

      if (concepto.includes('CCSS')) {
        montoCCSS = parseCRC(montoTexto);
      } else if (
        !concepto.includes('Das trabajados') &&
        !concepto.includes('Das libres')
      ) {
        salarioBruto += parseCRC(montoTexto);
      }

      y += 8;
    }
  });

  y += 4;

  doc.setFillColor(245, 245, 245);
  doc.rect(14, y, 182, 28, 'F');

  doc.setFontSize(11);
  doc.setTextColor(0, 0, 0);

  doc.text('Salario bruto:', 18, y + 8);
  doc.text(
    `CRC ${salarioBruto.toLocaleString('es-CR', { minimumFractionDigits: 2 })}`,
    195,
    y + 8,
    { align: 'right' }
  );

  doc.text('(-) CCSS:', 18, y + 16);
  doc.text(
    `CRC ${montoCCSS.toLocaleString('es-CR', { minimumFractionDigits: 2 })}`,
    195,
    y + 16,
    { align: 'right' }
  );

  y += 34;

  doc.setFillColor(...verdeClaro);
  doc.rect(14, y, 182, 14, 'F');

  doc.setFontSize(13);
  doc.setTextColor(...verde);
  doc.text('SALARIO NETO ESTIMADO A RECIBIR', 18, y + 9);

  const totalTexto = document
    .querySelector('.totallibre')
    .innerText
    .replace('', 'CRC ');

  doc.text(totalTexto, 195, y + 9, { align: 'right' });

  doc.setFontSize(9);
  doc.setTextColor(120, 120, 120);
  doc.text('Documento generado por RIVASTECH', 105, 285, { align: 'center' });

  doc.save('boleta-calculo-salario.pdf');
}
